/// converts a shift-jis characters to utf-16
/// \param s lvref to the pointer to the shift-jis characters; the pointer is incremented by the number of characters read
/// \return utf-16 character
constexpr cat2 shiftjis_to_utf16(add_lvref<const cat1*> s) noexcept {
  auto c = cat2(bitcast<nat1>(*s));
  if (c ^ 0x80) return ++s, c;
  else if (!(c & 0x60)) {
    if (c == 0x80) return ++s, 0xfffe;
    else if (s[1] < 0x40) return ++s, 0xfffe;
    else return s += 2, _::_shiftjis_table1[c - 0x81][s[1] - 0x40];
  } else if (c < 0xe0) {
    if (c == 0xa0) return ++s, 0xfffe;
    else return ++s, 0xfec0_c2 + c;
  } else if (c < 0xfd) {
    if (s[1] < 0x40) return ++s, 0xfffe;
    else return s += 2, _::_shiftjis_table2[c - 0xe0][s[1] - 0x40];
  } else return ++s, 0xfffe;
}

/// converts a shift-jis string to utf-16
/// \param s shift-jis string
/// \return utf-16 string
constexpr std::wstring shiftjis_to_utf16(std::string_view s) noexcept {
  std::wstring w;
  w.reserve(s.size());
  for (auto p = s.data(), e = p + s.size(); p < e;)
    w.push_back(shiftjis_to_utf16(p));
  return w;
}

