/// converts a utf-16 character to shift-jis
/// \param c utf-16 character
/// \param o lvref to the pointer to the shift-jis characters; the pointer is incremented by the number of characters written
constexpr void utf16_to_shiftjis(cat2 c, add_lvref<cat1*> o) noexcept {
  if (c < 0x0100) c = _::_unicode_table1[c];
  else if (c < 0x0391) c = 0x8888;
  else if (c < 0x0452) c = _::_unicode_table2[c - 0x0391];
  else if (c < 0x2010) c = 0x8888;
  else if (c < 0x2670) {
    if (c < 0x203c) c = _::_unicode_table3[c - 0x2010];
    else if (c < 0x2103) c = 0x8888;
    else if (c < 0x2313) c = _::_unicode_table4[c - 0x2103];
    else if (c < 0x2460) c = 0x8888;
    else if (c < 0x2474) c = _::_unicode_table5[c - 0x2460];
    else if (c < 0x2500) c = 0x8888;
    else c = _::_unicode_table6[c - 0x2500];
  } else if (c < 0x3000) c = 0x8888;
  else if (c < 0x3100) c = _::_unicode_table7[c - 0x3000];
  else if (c < 0x3231) c = 0x8888;
  else if (c < 0x33ce) c = _::_unicode_table8[c - 0x3231];
  else if (c < 0x4e00) c = 0x8888;
  else if (c < 0x9f9e) c = _::_unicode_table9[c - 0x4e00];
  else if (c < 0xe000) c = 0x8888;
  else if (c < 0xe760) c = _::_unicode_table10[c - 0xe000];
  else if (c < 0xf8f0) c = 0x8888;
  else if (c < 0xfa30) c = _::_unicode_table11[c - 0xf8f0];
  else if (c < 0xff00) c = 0x8888;
  else c = _::_unicode_table12[c - 0xff00];

  if (c & 0xff00) *o++ = bitcast<cat1>(nat1(c & 0xff)), *o++ = bitcast<cat1>(nat1(c >> 8));
  else *o++ = bitcast<cat1>(nat1(c));
}

